							+" comparability across economies and over time—with assumptions about the legal form of the business,\n its"
							+" size, its location and the nature of its operations. Questionnaires are administered to more than 11,400"
							+" local experts\n, including lawyers, business consultants, accountants, freight forwarders, government"
							+" officials and other\n professionals routinely administering or advising on legal and regulatory requirements.\n"
							+" These experts have several rounds of interaction with the Doing Business team, involving conference calls,\n"
							+" written correspondence and visits by the team.\n  The data from questionnaires are subjected to numerous"
							+" rounds of verification,\n leading to revisions or expansions of the information collected.\n"
							+"\nThe Doing Business methodology offers several advantages. It is transparent, using factual information\n"
							+" about what laws and regulations say and allowing multiple interactions with local respondents to clarify\n"
							+" potential misinterpretations of questions. Having representative samples of respondents is not an issue;\n"
							+" Doing Business is not a statistical survey, and the texts of the relevant laws and regulations are collected\n"
							+" and answers checked for accuracy. The methodology is inexpensive and easily replicable, so data can be\n"
							+" collected in a large sample of economies. Because standard assumptions are used in the data collection,\n"
							+" comparisons and benchmarks are valid across economies. Finally, the data not only highlight the extent\n"
